function applyInitialOSClass() {
  var osClass = '';

  if (navigator.userAgent.indexOf('Win') !== -1) osClass = 'os-windows';
  else if (navigator.userAgent.indexOf('Mac') !== -1) osClass = 'os-mac';
  else if (navigator.userAgent.indexOf('Linux') !== -1) osClass = 'os-linux';

  if (osClass) {
    document.documentElement.classList.add(osClass);

    // Apply soft_icon_bg class to the appropriate button
    if (osClass === 'os-windows') {
      showOS('windows', 'sWindow');
    } else if (osClass === 'os-mac') {
      showOS('macos', 'sMac');
    } else if (osClass === 'os-linux') {
      showOS('linux', 'sLinux');
    }
  }
}



function showOS(os, buttonId) {
  const osIds = ['dmacos', 'dwindows', 'dlinux'];
  const buttonIds = ['sMac', 'sWindow', 'sLinux'];

  osIds.forEach(id => {
    const element = document.getElementById(id);
    if (id === `d${os}`) {
      element.classList.remove('hidden');
    } else {
      element.classList.add('hidden');
    }
  });

  buttonIds.forEach(id => {
    const button = document.getElementById(id);
    if (id === buttonId) {
      button.classList.add('soft_icon_bg');
    } else {
      button.classList.remove('soft_icon_bg');
    }
  });
}

document.addEventListener('DOMContentLoaded', applyInitialOSClass);

function Copy(system) {
  let textToCopy;
  let copyTextElement;

  if (system === 'macos') {
    textToCopy = document.getElementById("macos-command").innerText;
    copyTextElement = document.getElementById("macos-copy-text");
  } else if (system === 'windows') {
    textToCopy = document.getElementById("windows-command").innerText;
    copyTextElement = document.getElementById("windows-copy-text");
  } else if (system === 'linux') {
    textToCopy = document.getElementById("linux-command").innerText;
    copyTextElement = document.getElementById("linux-copy-text");
  }

  navigator.clipboard.writeText(textToCopy).then(function () {
    copyTextElement.innerText = "Copied";
  }, function (err) {
    console.error('Could not copy text: ', err);
  });
}
